import React from 'react';
import Card from './Card';
import ColumnRow from './columnrow';

function Cardgroup() {
    return (
        <React.Fragment>
            <h1 className="news">BBC-NEWS</h1>
            <div class="row">
                <div className="col col-md-6 col-sm-12">
                    <Card />
                </div>
                <ColumnRow/>
            </div>
        </React.Fragment>
    )
}

export default Cardgroup;
